var Traj = {
  N: 1,
  E: 2,
  S: 3,
  W: 4,
  NE: 5,
  NW: 6,
  SW: 7,
  SW: 8,
};

function TracePoint(initx=0, inity=0, initTraj=Traj.N, initvalidList=[]){
	this.x = initx;
	this.y = inity;
	this.trajectory = initTraj;
	this.validList = initvalidList;
	this.length = 0;

	this.doTrajectoryIfValid = function(tryTrajectory) {
		var newx;
		var newy
		switch (tryTrajectory){
			case Traj.N:
				newy = this.y-1;
				newx = this.x;
				break;
			case Traj.E:
				newy = this.y;
				newx = this.x+1;
				break;
			case Traj.S:
				newy = this.y+1;
				newx = this.x;
				break;
			case Traj.W:
				newy = this.y;
				newx = this.x-1;
				break;
			case Traj.NE:
				newy = this.y-1;
				newx = this.x+1;
				break;
			case Traj.NW:
				newy = this.y-1;
				newx = this.x-1;
				break;
			case Traj.SE:
				newy = this.y+1;
				newx = this.x+1;
				break;
			case Traj.SW:
				newy = this.y+1;
				newx = this.x-1;
				break;
		}
		if(this.validList[newy][newx] == 1){
			console.log(newx + "," + newy);
			this.x = newx;
			this.y = newy;
			this.trajectory = tryTrajectory;
			this.validList[newy][newx] = 0;
			this.length += 1;
			return 1;
		}else{
			return 0;
		}
	}

	this.doNext = function(validList) {
		if(this.doTrajectoryIfValid(this.trajectory)){
			return 1; //existing path succeeded
		}else{
			var tryfirst = Math.round(Math.random()); //0 or 1
			var i; //0 to 1
			for (i=0; i<2; i++){
				var nextTrajectory;
				var totry = i*tryfirst;
				switch(this.trajectory){
					case Traj.N:
						if(totry){
							nextTrajectory = Traj.NE;
						}else{
							nextTrajectory = Traj.NW;
						}
						break;
					case Traj.E:
						if(totry){
							nextTrajectory = Traj.NE;
						}else{
							nextTrajectory = Traj.SE;
						}
						break;
					case Traj.S:
						if(totry){
							nextTrajectory = Traj.SE;
						}else{
							nextTrajectory = Traj.SW;
						}
						break;
					case Traj.W:
						if(totry){
							nextTrajectory = Traj.NW;
						}else{
							nextTrajectory = Traj.SW;
						}
						break;
					case Traj.NE:
						if(totry){
							nextTrajectory = Traj.N;
						}else{
							nextTrajectory = Traj.E;
						}
						break;
					case Traj.NW:
						if(totry){
							nextTrajectory = Traj.N;
						}else{
							nextTrajectory = Traj.W;
						}
						break;
					case Traj.SE:
						if(totry){
							nextTrajectory = Traj.S;
						}else{
							nextTrajectory = Traj.E;
						}
						break;
					case Traj.SW:
						if(totry){
							nextTrajectory = Traj.S;
						}else{
							nextTrajectory = Traj.W;
						}
						break;
				}
				if(this.doTrajectoryIfValid(nextTrajectory)){
					return 2; //this path succeeded
				}
			}
			return 0; //end here.  Nothing left to do.
		}
	}
};

